import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl, { waitUntil: 'domcontentloaded' });

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for search input and fill with 'iPhone'
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'iPhone');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_filled_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_filled_search.png'));

    // Click search button using multiple selector strategies
    const searchButton = await page.$('.search-btn') || await page.$('button[class*="search"]');
    if (searchButton) {
      await searchButton.click();
    } else {
      // Fallback to pressing Enter key
      await page.press('#searchInput', 'Enter');
    }

    // Wait for search results to load
    await page.waitForSelector('.product-card, .product-title, .results-count', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // Extract search results data
    const extractedData = {};
    const productTitles = await page.$$eval('.product-title', titles => 
      titles.slice(0, 5).map(t => t.textContent.trim())
    );
    extractedData.productTitles = productTitles;
    extractedData.resultCount = productTitles.length;

    return {
      success: true,
      action: "Searched for 'iPhone' products and captured results",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete iPhone product search",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
